import React from 'react';

const ChatbotEmbed = () => {
  return (
    <div>
      <script
        dangerouslySetInnerHTML={{
          __html: `
            window.embeddedChatbotConfig = {
              chatbotId: "bSBsdDP9ZT6TITPs_ToOO",
              domain: "www.chatbase.co"
            };
          `,
        }}
      />
      <script
        src="https://www.chatbase.co/embed.min.js"
        chatbotId="bSBsdDP9ZT6TITPs_ToOO"
        domain="www.chatbase.co"
        defer
      ></script>
    </div>
  );
};

export default ChatbotEmbed;
